func (suite *KeeperTestSuite) TestGetUnlockedTokensForZoneAllHaveDelegation() {
	suite.SetupTest()
	suite.setupTestZones()

	quicksilver := suite.GetQuicksilverApp(suite.chainA)
	ctx := suite.chainA.GetContext()

	zone, found := quicksilver.InterchainstakingKeeper.GetZone(ctx, suite.chainB.ChainID)
	vals := quicksilver.InterchainstakingKeeper.GetValidators(ctx, zone.ChainId)
	suite.True(found)

	quicksilver.InterchainstakingKeeper.SetDelegation(ctx, zone.ChainId, types.NewDelegation(zone.DelegationAddress.Address, vals[0].ValoperAddress, sdk.NewCoin(zone.BaseDenom, sdk.NewInt(100))))
	quicksilver.InterchainstakingKeeper.SetDelegation(ctx, zone.ChainId, types.NewDelegation(zone.DelegationAddress.Address, vals[1].ValoperAddress, sdk.NewCoin(zone.BaseDenom, sdk.NewInt(100))))
	quicksilver.InterchainstakingKeeper.SetDelegation(ctx, zone.ChainId, types.NewDelegation(zone.DelegationAddress.Address, vals[2].ValoperAddress, sdk.NewCoin(zone.BaseDenom, sdk.NewInt(100))))
	quicksilver.InterchainstakingKeeper.SetDelegation(ctx, zone.ChainId, types.NewDelegation(zone.DelegationAddress.Address, vals[3].ValoperAddress, sdk.NewCoin(zone.BaseDenom, sdk.NewInt(100))))

	availPerVal, total, err := quicksilver.InterchainstakingKeeper.GetUnlockedTokensForZone(ctx, &zone)
	suite.NoError(err)
	suite.Equal(sdk.NewInt(400), total)
	for _, x := range availPerVal {
		suite.Equal(sdk.NewInt(100), x)
	}
}

func (suite *KeeperTestSuite) TestGetUnlockedTokensForZoneNotAllHaveDelegation() {
	suite.SetupTest()
	suite.setupTestZones()

	quicksilver := suite.GetQuicksilverApp(suite.chainA)
	ctx := suite.chainA.GetContext()

	zone, found := quicksilver.InterchainstakingKeeper.GetZone(ctx, suite.chainB.ChainID)
	vals := quicksilver.InterchainstakingKeeper.GetValidators(ctx, zone.ChainId)
	suite.True(found)

	quicksilver.InterchainstakingKeeper.SetDelegation(ctx, zone.ChainId, types.NewDelegation(zone.DelegationAddress.Address, vals[0].ValoperAddress, sdk.NewCoin(zone.BaseDenom, sdk.NewInt(100))))
	quicksilver.InterchainstakingKeeper.SetDelegation(ctx, zone.ChainId, types.NewDelegation(zone.DelegationAddress.Address, vals[1].ValoperAddress, sdk.NewCoin(zone.BaseDenom, sdk.NewInt(100))))
	quicksilver.InterchainstakingKeeper.SetDelegation(ctx, zone.ChainId, types.NewDelegation(zone.DelegationAddress.Address, vals[2].ValoperAddress, sdk.NewCoin(zone.BaseDenom, sdk.NewInt(100))))

	availPerVal, total, err := quicksilver.InterchainstakingKeeper.GetUnlockedTokensForZone(ctx, &zone)
	suite.NoError(err)
	suite.Equal(sdk.NewInt(300), total)

	// ensure all vals exist in list, even if no delegation
	for _, v := range vals {
		_, found := availPerVal[v.ValoperAddress]
		suite.True(found)
	}
}

func TestAllocateWithdrawalsFromValidatorsNonEmptyMaps(t *testing.T) {
	// clones required because original values get amended
	tokensAllocatedForWithdrawalPerValidator := make(map[string]sdkmath.Int)
	tokensAllocatedForWithdrawalPerValidator["validator1"] = sdkmath.NewInt(100)
	tokensAllocatedForWithdrawalPerValidator["validator2"] = sdkmath.NewInt(200)

	_tokensAllocatedForWithdrawalPerValidator := make(map[string]sdkmath.Int)
	_tokensAllocatedForWithdrawalPerValidator["validator1"] = sdkmath.NewInt(100)
	_tokensAllocatedForWithdrawalPerValidator["validator2"] = sdkmath.NewInt(200)

	amountToWithdrawPerWithdrawal := make(map[string]sdk.Coin)
	amountToWithdrawPerWithdrawal["withdrawal1"] = sdk.NewCoin("denom", sdkmath.NewInt(150))
	amountToWithdrawPerWithdrawal["withdrawal2"] = sdk.NewCoin("denom", sdkmath.NewInt(50))
	amountToWithdrawPerWithdrawal["withdrawal3"] = sdk.NewCoin("denom", sdkmath.NewInt(75))
	amountToWithdrawPerWithdrawal["withdrawal4"] = sdk.NewCoin("denom", sdkmath.NewInt(25))

	_amountToWithdrawPerWithdrawal := make(map[string]sdk.Coin)
	_amountToWithdrawPerWithdrawal["withdrawal1"] = sdk.NewCoin("denom", sdkmath.NewInt(150))
	_amountToWithdrawPerWithdrawal["withdrawal2"] = sdk.NewCoin("denom", sdkmath.NewInt(50))
	_amountToWithdrawPerWithdrawal["withdrawal3"] = sdk.NewCoin("denom", sdkmath.NewInt(75))
	_amountToWithdrawPerWithdrawal["withdrawal4"] = sdk.NewCoin("denom", sdkmath.NewInt(25))

	distributionsPerWithdrawal := map[string][]*types.Distribution{
		"withdrawal1": make([]*types.Distribution, 0),
		"withdrawal2": make([]*types.Distribution, 0),
		"withdrawal3": make([]*types.Distribution, 0),
		"withdrawal4": make([]*types.Distribution, 0),
	}

	coinsOutPerValidator, _, distributions, err := keeper.AllocateWithdrawalsFromValidators("denom", tokensAllocatedForWithdrawalPerValidator, amountToWithdrawPerWithdrawal, distributionsPerWithdrawal)
	require.NoError(t, err)
	for valoper, amount := range _tokensAllocatedForWithdrawalPerValidator {
		require.Equal(t, amount, coinsOutPerValidator[valoper].Amount)
	}

	for hash, dist := range distributions {
		sum := sdkmath.ZeroInt()
		for _, distLine := range dist {
			sum = sum.Add(distLine.Amount)
		}
		require.Equal(t, _amountToWithdrawPerWithdrawal[hash].Amount, sum)
	}
}

func (suite *KeeperTestSuite) TestGetUnlockedTokensForZoneWithRedelegation() {
	suite.SetupTest()
	suite.setupTestZones()

	quicksilver := suite.GetQuicksilverApp(suite.chainA)
	ctx := suite.chainA.GetContext()

	zone, found := quicksilver.InterchainstakingKeeper.GetZone(ctx, suite.chainB.ChainID)
	vals := quicksilver.InterchainstakingKeeper.GetValidators(ctx, zone.ChainId)
	suite.True(found)

	quicksilver.InterchainstakingKeeper.SetDelegation(ctx, zone.ChainId, types.NewDelegation(zone.DelegationAddress.Address, vals[0].ValoperAddress, sdk.NewCoin(zone.BaseDenom, sdk.NewInt(100))))
	quicksilver.InterchainstakingKeeper.SetDelegation(ctx, zone.ChainId, types.NewDelegation(zone.DelegationAddress.Address, vals[1].ValoperAddress, sdk.NewCoin(zone.BaseDenom, sdk.NewInt(100))))
	quicksilver.InterchainstakingKeeper.SetDelegation(ctx, zone.ChainId, types.NewDelegation(zone.DelegationAddress.Address, vals[2].ValoperAddress, sdk.NewCoin(zone.BaseDenom, sdk.NewInt(100))))
	quicksilver.InterchainstakingKeeper.SetDelegation(ctx, zone.ChainId, types.NewDelegation(zone.DelegationAddress.Address, vals[3].ValoperAddress, sdk.NewCoin(zone.BaseDenom, sdk.NewInt(100))))

	quicksilver.InterchainstakingKeeper.SetRedelegationRecord(ctx, types.RedelegationRecord{ChainId: zone.ChainId, EpochNumber: 1, Source: vals[0].ValoperAddress, Destination: vals[2].ValoperAddress, Amount: sdkmath.NewInt(5)})
	quicksilver.InterchainstakingKeeper.SetRedelegationRecord(ctx, types.RedelegationRecord{ChainId: zone.ChainId, EpochNumber: 2, Source: vals[0].ValoperAddress, Destination: vals[2].ValoperAddress, Amount: sdkmath.NewInt(5)})
	quicksilver.InterchainstakingKeeper.SetRedelegationRecord(ctx, types.RedelegationRecord{ChainId: zone.ChainId, EpochNumber: 2, Source: vals[1].ValoperAddress, Destination: vals[2].ValoperAddress, Amount: sdkmath.NewInt(5)})

	availPerVal, total, err := quicksilver.InterchainstakingKeeper.GetUnlockedTokensForZone(ctx, &zone)
	suite.NoError(err)
	suite.Equal(sdk.NewInt(385), total)
	suite.Equal(sdk.NewInt(85), availPerVal[vals[2].ValoperAddress])
}

